import React from "react";

export const InvestmentView = (props) => {
  const { detail } = props;

  return (
    <div className="pricing-container">
      <>
        {detail.map((item) => (
          <ul>
            <>
              <h1>{item.type}</h1>
              <li>{item.price}</li>
              <li>{item.detail}</li>
            </>
          </ul>
        ))}
      </>
    </div>
  );
};
export default InvestmentView;
